graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "a" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>a</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "temp" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>temp</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "data" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>data</b></td></tr></table>>, pad=0.5, shape=folder, fillcolor="#E8F5E9", style=filled, color="#388E3C"];
  "thisIsAReallyLongNodeNameThatIsHardToRead" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>thisIsAReallyLongNodeNameThatIsHardToRead</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "MyNode" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>MyNode</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "my_other_node" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>my_other_node</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ANOTHER_NODE" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ANOTHER_NODE</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  subgraph cluster_System {
    label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>System</b></td></tr></table>>;
    labelloc="t";
    style=filled;
    fontsize=10;
    fillcolor="#FFFFFF";
    color="#999999";
    "System__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

    subgraph cluster_API {
      label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>API</b></td></tr></table>>;
      labelloc="t";
      style=filled;
      fontsize=10;
      fillcolor="#FFFFFF";
      color="#999999";
      "API__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

      subgraph cluster_Services {
        label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Services</b></td></tr></table>>;
        labelloc="t";
        style=filled;
        fontsize=10;
        fillcolor="#FFFFFF";
        color="#999999";
        "Services__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

        subgraph cluster_Users {
          label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Users</b></td></tr></table>>;
          labelloc="t";
          style=filled;
          fontsize=10;
          fillcolor="#FFFFFF";
          color="#999999";
          "Users__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

          subgraph cluster_Controllers {
            label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Controllers</b></td></tr></table>>;
            labelloc="t";
            style=filled;
            fontsize=10;
            fillcolor="#FFFFFF";
            color="#999999";
            "Controllers__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

            subgraph cluster_Handlers {
              label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="2"><tr><td align="center"><b>Handlers</b></td></tr></table>>;
              labelloc="t";
              style=filled;
              fontsize=10;
              fillcolor="#FFFFFF";
              color="#999999";
              "Handlers__cluster_anchor" [shape=point, width=0.01, height=0.01, label="", style=invis, fixedsize=true];

              "GetProfile" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>GetProfile</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
            }
          }
        }
      }
    }
  }

}
